.el-table__footer-wrapper tbody td {
	background: #fbfdbd;
}
.operation-icon {
	font-size: 24px;
	cursor: pointer;
	vertical-align: -4px;
}
.list-wrap {
	display: none;
	padding: 10px 47px;
	top: 80px;
	right: 30px;
	position: absolute;
	z-index: 9999;
	background-color: rgba(242, 242, 242, 1);
	transition: all 0.5s;
	.list-single {
		margin-bottom: 10px;
	}
}
.list-wrap-active {
	display: block;
}
.total {
	padding: 0 0 10px 0;
	color: #666;
	font-size: 14px;
	display: flex;
	flex-wrap: wrap;
	justify-content: flex-start;
	> div {
		flex: 0 0 270px;
		height: 20px;
		line-height: 20px;
	}
}
.el-table__fixed-right {
	background: #fff;
}

.el-table__footer .cell {
	word-break: break-word;
}
.my-footer-content {
	overflow: auto;
}

.my-footer {
	height: 40px;
	line-height: 40px;
	width: 100%;
	border-left: 1px solid #f1f1f1;
	border-right: 1px solid #f1f1f1;
	border-bottom: 1px solid #f1f1f1;
	color: #666;
	font-size: 14px;
	text-align: center;
	display: flex;

	> div {
		border-right: 1px solid #f1f1f1;
		padding: 0 10px;
	}

	> div:nth-child(1) {
		width: 60px;
	}
}
